        return(
            <div className="skills_page_container">
                <div className="skills_title_container">
                    <div className="skills_lists_container">
                        <div className="skills_column">
                            <ul className="skills_list">

                            </ul>
                        </div>
                        <div className="skills_column">
                            <ul className="skills_list">
                                
                            </ul>
                        </div>
                    </div>
                </div>
            </div>
        )
    }
}

export default Skills;
